  const { isLoaded } = useLoadScript({
    googleMapsApiKey: process.env.API_KEY, 
  });

  return <SearchMap/>
}

function SearchMap(){
  const center = useMemo(() => ({lat: 44, lng:-80}), []);

  return(
    <GoogleMap zoom={10} center={center}>

    </GoogleMap>
  );
}



